A vintage programme from a turbulent time in Americas past. Considered controversial at the time, 
it features footage of Simon and Garfunkel on stage, in the studio and on tour. It also integrates 
video montages of key events of the era, including news clips of Martin Luther King, Robert Kennedy, 
activist Cesar Chavez and the Poor People's March on Washington. Songs include America, So Long, 
Frank Lloyd Wright, Bridge over Troubled Water, Scarborough Fair, El Condor Pasa (If I Could) 
Punkys Dilemma, Mrs Robinson, Mystery Train, The 59th Street Bridge Song (Feelin' Groovy) The Boxer 
Homeward Bound, The Sound of Silence and several others.


